import React, { Component } from 'react';   

class FeaturedSeries extends Component {
    state = {  }
    render() { 
        return ( 
            <div>
                 <div>Series Name</div>
                 <button className='btn btn-link'>Summary</button>
                 <button className='btn btn-link'>Schedule</button>
                 <button className='btn btn-link'>videos</button>
                 <button className='btn btn-link'>Point Table</button>
                 <div>This is Featured Video </div>
            </div>
         );
    }
}
 
export default FeaturedSeries;
